<blockquote data-start="1995" data-end="2049">
<p data-start="1997" data-end="2049" class="">"화면 상단 주소창을 <strong data-start="2009" data-end="2047">복사하여 MetaMask 앱의 브라우저에서 붙여넣고 열어주세요</strong>."</p>
</blockquote>
