<p data-start="240" data-end="310" class=""><strong data-start="240" data-end="310">맞습니다. MetaMask 앱이 열리긴 하지만 사용자가 직접 브라우저 탭으로 가서 주소를 입력하거나 붙여넣어야 합니다.</strong></p>
